	private String name;
	
	private String path;
	
	private int size;
	
	private TerminalGraphNodeType(String name, String path, int size){
		this.name = name;
		this.path = path;
		this.size = size;
	}
	
	public String getName(){
		return this.name;
	}
	
	public String getPath(){
		return this.path;
	}
	
	public int getSize(){
		return this.size;
	}
	
	public static TerminalGraphNodeType fromName(String name) throws Exception{
		TerminalGraphNodeType[] values = TerminalGraphNodeType.values();
		for(TerminalGraphNodeType value:values){
			if(value.getName().equals(name)){
				return value;
			}
		}
		throw new ErrorTypeException("name", name);
	}
	
